import React, { useState } from 'react';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    alert('Thank you for your message! We will get back to you soon.');
    setFormData({ name: '', email: '', message: '' });
  };

  return (
    <div className="container py-5">
      <h2 className="text-center mb-5" style={{ color: '#FF1493' }}>Contact Us</h2>
      <div className="row justify-content-center">
        <div className="col-md-6">
          <form onSubmit={handleSubmit} style={{ backgroundColor: '#FFF0F5', padding: '2rem', borderRadius: '15px', boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)' }}>
            <div className="mb-3">
              <label htmlFor="name" className="form-label" style={{ color: '#FF69B4' }}>Name</label>
              <input
                type="text"
                className="form-control"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                style={{ borderColor: '#FF69B4' }}
              />
            </div>
            <div className="mb-3">
              <label htmlFor="email" className="form-label" style={{ color: '#FF69B4' }}>Email</label>
              <input
                type="email"
                className="form-control"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                style={{ borderColor: '#FF69B4' }}
              />
            </div>
            <div className="mb-3">
              <label htmlFor="message" className="form-label" style={{ color: '#FF69B4' }}>Message</label>
              <textarea
                className="form-control"
                id="message"
                name="message"
                rows="4"
                value={formData.message}
                onChange={handleChange}
                required
                style={{ borderColor: '#FF69B4' }}
              ></textarea>
            </div>
            <button type="submit" className="btn w-100" style={{ backgroundColor: '#FF1493', color: 'white' }}>
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Contact;
